import React from 'react';
import "./style.css";

export default (props) => {
    return (
    <div
        className="cardStyle"
        onClick={() => props.setClicked(props.id)}
    >
        <div className="imgContainer">
            <img
                className="img"
                alt={props.name}
                src={props.image}
            />
        </div>
    </div>
)};
